/**
 * @name presets
 * @description Stores the possible presets for the menu
 * @type {string[]}
 */
let presets = ["Empty", "Random"];

/**
 * @name model
 * @description Stores the model/algorithm names for the menu
 * @type {string[]}
 */
let model = ["2DArrayNaive", "2DArrayOptimized", "CellQueue",  "All"];


/**
 * @name Menu
 * @description A dictionary that is controlled my the menu
 * @type {{resolutionX: number, resolutionY: number, color: string, speed: number, probability: number, startBool: boolean, drawBool: boolean, presets: (string|string), model: (string|string), start: function, stop: function, next: function, reset: function, save: function, load: function, number_of_generations: number, number_of_deaths: number, number_of_births: number, number_alive: number, time_to_calculate_naive: string, time_to_calculate_better: string, time_to_calculate_queue: string}}
 */
let Menu = {
    resolutionX: 68,
    resolutionY: 30,
    color: "#000",
    speed: 10.0,
    probability: 0.4,
    startBool: false,
    drawBool: false,
    presets: presets[0],
    model: model[0],
    /**
     * @name start
     * @description starts the Game of Live
     */
    start: function start() {
        this.startBool = true;
    },
    /**
     * @name stop
     * @description stops the Game of Live
     */
    stop: function stop() {
        this.startBool = false;
    },
    /**
     * @name nextGeneration
     * @description only calculates the next frame
     */
    next: function nextGeneration() {
        drawNextGrid();
    },
    /**
     * @name resetGrid
     * @description resets the Grid
     */
    reset: function resetGrid() {
        Menu.startBool = false;
        Menu.presets = (Menu.presets.localeCompare(presets[0]) === 0 || Menu.presets.localeCompare(presets[1]) === 0) ? Menu.presets : presets[0];
        window.sketch.setup();
    },
    /**
     * @name saveGrid
     * @description saves the current grid with the help of html
     * @description stringify the grid to a json and creates a download link, which is automatically opened and the json is saved in a document called cell.json
     */
    save: function saveGrid(){
        let object;
        if(!swap){
            object = buffer1;
        }
        else {
            object = buffer2;
        }

        let blob = new Blob( [ JSON.stringify(object) ], {
            type: 'application/json'
        });

        let url = URL.createObjectURL( blob );
        let link = document.createElement( 'a' );
        link.setAttribute( 'href', url );
        link.setAttribute( 'download', 'cell.json' );

        let event = document.createEvent( 'MouseEvents' );
        event.initMouseEvent( 'click', true, true, window, 1, 0, 0, 0, 0, false, false, false, false, 0, null);
        link.dispatchEvent( event );
    },
    /**
     * @name loadGrid
     * @description loads and displays a saved grid
     * @description opens a file manager through a html event, where a document can be selected and opened
     */
    load: function loadGrid(){
        Menu.startBool = false;
        let input = document.getElementById('myInput');
        input.addEventListener('change', function() {
            let file = input.files[0];
            if (file) {
                let reader = new FileReader();
                reader.readAsText(file);
                reader.onload = function (e) {
                    swap = false;
                    buffer1 = JSON.parse(e.target.result);
                    buffer2 = make2DArray(buffer1.length, buffer1[0].length);

                    Menu.resolutionY = buffer1.length;
                    Menu.resolutionX = buffer1[0].length;

                    if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                        initCellQueueAlgorithm(buffer1);

                    boxSize = Math.min((window.sketch.windowWidth-windowWidthResize)/Menu.resolutionX, (window.sketch.windowHeight-windowHeightResize)/Menu.resolutionY);
                    drawCells(buffer1);

                    Menu.number_of_generations = 0;
                    Menu.number_alive = countAliveCells(buffer1);
                    Menu.number_of_births = 0;
                    Menu.number_of_deaths = 0;
                };
                reader.onerror = function (e) {
                    console.error("Could not load the File");
                };
            }
        });
        input.click();
    },
    number_of_generations: 0,
    number_of_deaths: 0,
    number_of_births: 0,
    number_alive : 0,
    time_to_calculate_naive: "0.0",
    time_to_calculate_better: "0.0",
    time_to_calculate_queue: "0.0",
};

/**
 * @name onload
 * @description function that is called when the site is loaded
 * */
window.onload = function () {
    presets.push(...Object.keys(presetsDatabase));
    lookupTable = calculateLookupTable();

    /**
     * all menu elements are added to the menu in three specified folders: visualizationFolder, functionFolder and informationFolder
     * @name modifierFunctions
     * @description dictionary to controll all menu elements
     * @type {{}}
     */
    let modifierFunctions= { };
    let gui = new dat.GUI({width: 350});
    let visualizationFolder = gui.addFolder('Visual Controller');
    modifierFunctions["resolutionX"] = visualizationFolder.add(Menu, "resolutionX").name("Resolution X").min(3).max(200).step(1);
    modifierFunctions["resolutionY"] = visualizationFolder.add(Menu, "resolutionY").name("Resolution Y").min(3).max(100).step(1);
    modifierFunctions["color"] = visualizationFolder.addColor(Menu, "color").name("Color");
    visualizationFolder.open();
    let functionFolder = gui.addFolder('Functional Controller');
    modifierFunctions["speed"] = functionFolder.add(Menu, "speed", 0, 30).name("Speed");
    modifierFunctions["presets"] = functionFolder.add(Menu, "presets", presets).name("Presets");
    modifierFunctions["model"] = functionFolder.add(Menu, "model", model).name("Calculation Algorithm");
    modifierFunctions["draw"] = functionFolder.add(Menu, "drawBool").name("Draw");
    functionFolder.add(Menu, "start").name("Start");
    functionFolder.add(Menu, "stop").name("Stop");
    functionFolder.add(Menu, "next").name("Next Generation");
    functionFolder.add(Menu, "reset").name("Reset Grid");
    functionFolder.add(Menu, "save").name("Save");
    functionFolder.add(Menu, "load").name("Load");
    functionFolder.open();
    let informationFolder = gui.addFolder('Information');
    modifierFunctions["generation"] = informationFolder.add(Menu, "number_of_generations").name("Generation Number");
    modifierFunctions["generation"].domElement.style.pointerEvents = "none";
    modifierFunctions["alive"] = informationFolder.add(Menu, "number_alive").name("Number of Alive Cells");
    modifierFunctions["alive"].domElement.style.pointerEvents = "none";
    modifierFunctions["births"] = informationFolder.add(Menu, "number_of_births").name("Number of Births");
    modifierFunctions["births"].domElement.style.pointerEvents = "none";
    modifierFunctions["deaths"] = informationFolder.add(Menu, "number_of_deaths").name("Number if Deaths");
    modifierFunctions["deaths"].domElement.style.pointerEvents = "none";
    modifierFunctions["time"] = [informationFolder.add(Menu, "time_to_calculate_naive").name("Calc Time (Naive)")];
    modifierFunctions["time"][0].domElement.style.pointerEvents = "none";
    informationFolder.open();


    /**
     * @name update
     * @description updates the values in every menu folder, if a value is changed in code
     */
    function update () {
        requestAnimationFrame ( update );
        for (let i in visualizationFolder.__controllers) {
            visualizationFolder.__controllers[i].updateDisplay();
        }
        for (let i in functionFolder.__controllers) {
            functionFolder.__controllers[i].updateDisplay();
        }
        for (let i in informationFolder.__controllers) {
            informationFolder.__controllers[i].updateDisplay();
        }
    }

    /**
     * @name loop
     * @description defines for every modifier a onChange Event
     * @param {string} modifier
     */
    function loop (modifier) {
        modifierFunctions[modifier].onChange(function (value) {
            Menu[modifier] = value;
            if(modifier.localeCompare("resolutionX")===0 || modifier.localeCompare("resolutionY")===0){
                Menu.startBool = false;
                Menu.drawBool = false;

                Menu.number_of_generations = 0;
                Menu.number_alive = 0;
                Menu.number_of_births = 0;
                Menu.number_of_deaths = 0;

                boxSize = Math.min((window.sketch.windowWidth-windowWidthResize)/Menu.resolutionX, (window.sketch.windowHeight-windowHeightResize)/Menu.resolutionY);
                if(!swap)
                    buffer1 = copyBuffer(buffer1, Menu.resolutionY, Menu.resolutionX);
                else
                    buffer1 = copyBuffer(buffer2, Menu.resolutionY, Menu.resolutionX);

                if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                    initCellQueueAlgorithm(buffer1);

                swap = false;
                buffer2 = make2DArray(Menu.resolutionY, Menu.resolutionX);
                drawCells(buffer1);
            } else if(modifier.localeCompare("color")===0) {
                if (!swap)
                    drawCells(buffer1);
                else
                    drawCells(buffer2);
            } else if (modifier.localeCompare("speed")===0){
                window.sketch.frameRate(value);
            } else if(modifier.localeCompare("presets")===0) {
                Menu.startBool = false;
                if (value.localeCompare(presets[1])===0) {
                    modifierFunctions["probability"] = functionFolder.add(Menu, "probability", 0, 1).name("Probability for live Cell");
                }
                else{
                    if(("probability" in modifierFunctions) && modifierFunctions["probability"]!==undefined){
                        functionFolder.remove(modifierFunctions["probability"]);
                        delete modifierFunctions["probability"];
                    }
                }

                if (value.localeCompare(presets[1])!==0 && value.localeCompare(presets[0])!==0){
                    swap = false;
                    buffer1 = (presetsDatabase[value].grid).slice(0);
                    buffer2 = make2DArray(buffer1.length, buffer1[0].length);

                    Menu.resolutionY = buffer1.length;
                    Menu.resolutionX = buffer1[0].length;

                    if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                        initCellQueueAlgorithm(buffer1);

                    Menu.number_of_generations = 0;
                    Menu.number_alive = countAliveCells(buffer1);
                    Menu.number_of_births = 0;
                    Menu.number_of_deaths = 0;

                    boxSize = Math.min((window.sketch.windowWidth-windowWidthResize)/Menu.resolutionX, (window.sketch.windowHeight-windowHeightResize)/Menu.resolutionY);
                    drawCells(buffer1);
                }
                else {
                    window.sketch.setup();
                }

            } else if(modifier.localeCompare("model")===0){
                for (let i = 0; i < modifierFunctions["time"].length; i++) {
                    informationFolder.remove(modifierFunctions["time"][i]);
                }

                if(value.localeCompare(model[0]) === 0)
                    modifierFunctions["time"] = [informationFolder.add(Menu, "time_to_calculate_naive").name("Calc Time (Naive)")];
                else if(value.localeCompare(model[1]) === 0)
                    modifierFunctions["time"] = [informationFolder.add(Menu, "time_to_calculate_better").name("Calc Time (Optimized)")];
                else if(value.localeCompare(model[2]) === 0){
                    if(!swap)
                        initCellQueueAlgorithm(buffer1);
                    else
                        initCellQueueAlgorithm(buffer2);
                    modifierFunctions["time"] = [informationFolder.add(Menu, "time_to_calculate_queue").name("Calc Time (Queue)")];
                }
                else if(value.localeCompare(model[3]) === 0){
                    modifierFunctions["time"] = [informationFolder.add(Menu, "time_to_calculate_naive").name("Calc Time (Naive)"),
                        informationFolder.add(Menu, "time_to_calculate_better").name("Calc Time (Optimized)"),
                        informationFolder.add(Menu, "time_to_calculate_queue").name("Calc Time (Queue)")];
                    if(!swap)
                        initCellQueueAlgorithm(buffer1);
                    else
                        initCellQueueAlgorithm(buffer2);
                }

                for (let i = 0; i < modifierFunctions["time"].length; i++){
                    modifierFunctions["time"][i].domElement.style.pointerEvents = "none";
                }
            }
        });
    }

    for (let modifier in modifierFunctions) {
        if(modifier.localeCompare("time") !== 0)
            loop(modifier);
    }

    update();
};

let buffer1;
let buffer2;
let swap;

let stateBuffer;
let xQueue;
let yQueue;
let activeCells;

let boxSize;
let windowWidthResize = 400;
let windowHeightResize = 30;

let lookupTable;

/**
 * @name make2DArray
 * @description generates a row x columns grid (2 dimensional Array) filled with false values
 * @param {int} rows
 * @param {int} columns
 * @returns {boolean[][]}
 */
function make2DArray(rows, columns) {
    if(rows < 1 || columns < 1){
        console.error("ArrayError: Not an appropriate number of rows or columns");
        return null;
    }

    let array = new Array(rows);
    for (let i = 0; i<array.length; i++){
        array[i] = new Array(columns);
        array[i].fill(false);
    }
    return array;
}

/**
 * @name fillRandomGrid
 * @description fills the grid randomly with true or false values. The probability is read from the Menu instance.
 * @param {boolean[][]} grid
 * @param {number} prob - Probability of cell to be alive
 */
function fillRandomGrid(grid, prob) {
    if(!Array.isArray(grid) || !Array.isArray(grid[0])){
        console.error("ArrayError: fillRandomGrid: param grid is not a 2D Array");
        return;
    }
    if(prob < 0 || prob > 1){
        console.error("fillRandomGridError: param prob is not in the interval [0,1]");
        return;
    }
    let temp = 0;
    for (let i = 0; i<grid.length; i++){
        for (let j = 0; j<grid[i].length; j++){
            temp = window.sketch.random();
            if (temp < prob){
                grid[i][j] = true;
                Menu.number_alive++;
            }
            else {
                grid[i][j] = false;
            }
        }
    }
}

/**
 * @name countAliveCells
 * @description counts the true values in the grid and returns the number
 * @param {boolean[][]} grid
 * @returns {number}
 */
function countAliveCells(grid) {
    if(!Array.isArray(grid) || !Array.isArray(grid[0])){
        console.error("ArrayError: countAliveCells: param grid is not a 2D Array");
        return -1;
    }
    let counter = 0;
    for (let i = 0; i<grid.length; i++){
        for (let j = 0; j<grid[i].length; j++){
            if (grid[i][j]){
                counter++;
            }
        }
    }
    return counter;
}

/**
 * @name copyBuffer
 * @description copies a grid into a new smaller, bigger or equal (defined by toY and toX) size grid
 * @param {boolean[][]} from
 * @param {int} toY
 * @param {int} toX
 * @returns {boolean[][]}
 */
function copyBuffer(from, toY, toX) {
    if(!Array.isArray(from) || !Array.isArray(from[0])){
        console.error("ArrayError: countAliveCells: param from is not a 2D Array");
        return null;
    }

    let tempBuffer = make2DArray(toY,toX);
    for (let i = 0; i<toY; i++){
        for(let j = 0; j<toX; j++){
            if(from[i] !== undefined && from[i][j] !== undefined){
                if(from[i][j])
                    Menu.number_alive++;
                tempBuffer[i][j] = from[i][j];
            }
        }
    }
    return tempBuffer;
}

/**
 * @name calculateNextGenerationNaive
 * @description calculates the next Generation of the Game of Life in a naive and simple way by counting the neighbors directly
 * @param {boolean[][]} current
 * @param {boolean[][]} next - grid of the same size as current
 */
function calculateNextGenerationNaive(current, next) {
    if(current.length !== next.length || current[0].length !== next[0].length){
        console.error("Error: Grids haven't the same dimension");
        return;
    }

    let t0 = performance.now();
    Menu.number_of_generations++;
    Menu.number_of_deaths = 0;
    Menu.number_of_births = 0;
    let neighbors = 0;
    for (let y = 0; y<current.length; y++){
        for (let x = 0; x<current[y].length; x++){

            for (let i = -1; i<=1; i++){
                for (let j = -1; j<=1; j++){
                    if(!(i===0 && j===0)){
                        neighbors += current[(y+i+current.length)%current.length][(x+j+current[0].length)%current[0].length] ? 1:0;
                    }
                }
            }

            if (current[y][x] && neighbors<2){
                Menu.number_of_deaths++;
                next[y][x] = false;
            }
            else if (current[y][x] && neighbors > 3){
                Menu.number_of_deaths++;
                next[y][x] = false;
            }
            else if (current[y][x] && (neighbors === 2 || neighbors === 3)){
                next[y][x] = true;
            }
            else if ((!current[y][x] && neighbors === 3)){
                Menu.number_of_births++;
                next[y][x] = true;
            }
            else{
                next[y][x] = false;
            }

            neighbors = 0;
        }
    }

    Menu.number_alive = Menu.number_alive - Menu.number_of_deaths + Menu.number_of_births;
    let t1 = performance.now();
    Menu.time_to_calculate_naive = (t1-t0).toString();
}

/**
 * @name calculateLookupTable
 * @description calculates a lookup table for the improved algorithm to calculate the next generation of the game of live
 * @description lookup table provides information about what happens to a cell with a specific neighbor constellation
 * @returns {boolean[]}
 */
function calculateLookupTable() {
    let table = new Array(512);
    for(let i = 0; i < table.length; i++){
        let temp = i;
        let count = 0;
        let alive = ((Math.trunc(temp/16))%2 === 1);
        while (temp > 0){
            count += temp%2;
            temp = Math.trunc(temp/2);
        }

        if (alive && count<3)
            table[i] = false;
        else if (alive && count > 4)
            table[i] = false;
        else if (alive && (count === 3 || count === 4))
            table[i] = true;
        else
            table[i] = (!alive && count === 3);
    }
    return table;
}

/**
 * @name calculateNextGenerationBetter
 * @description calculates the next generation of the Game of Live in an improved way
 * @description instead of making 8 reads around the cell, this algorithm reuses the old values and only have to do additional 3 reads for one cell
 * @param {boolean[][]} current
 * @param {boolean[][]} next
 */
function calculateNextGenerationBetter(current, next) {
    if(current.length !== next.length || current[0].length !== next[0].length){
        console.error("Error: Grids haven't the same dimension");
        return;
    }

    let t0 = performance.now();
    Menu.number_of_generations++;
    Menu.number_of_deaths = 0;
    Menu.number_of_births = 0;
    let environment = 0;
    for(let y = 0; y < current.length; y++){
        environment = (current[((y - 1) + current.length) % current.length][current[0].length-1] ? 32 : 0) + (current[((y - 1) + current.length) % current.length][0] ? 4 : 0)
                    + (current[((y    ) + current.length) % current.length][current[0].length-1] ? 16 : 0) + (current[((y    ) + current.length) % current.length][0] ? 2 : 0)
                    + (current[((y + 1) + current.length) % current.length][current[0].length-1] ?  8 : 0) + (current[((y + 1) + current.length) % current.length][0] ? 1 : 0);

        let prevRow = current[((y - 1) + current.length) % current.length],
            currRow = current[((y    ) + current.length) % current.length],
            nextRow = current[((y + 1) + current.length) % current.length];
        for(let x = 0; x < current[0].length; x++){
            environment = ((environment % 64) * 8)
                + (prevRow[((x + 1) + current[0].length) % current[0].length] ?  4 : 0)
                + (currRow[((x + 1) + current[0].length) % current[0].length] ?  2 : 0)
                + (nextRow[((x + 1) + current[0].length) % current[0].length] ?  1 : 0);
            next[y][x] = lookupTable[environment];
            if(next[y][x] && !current[y][x])
                Menu.number_of_births++;
            else if(!next[y][x] && current[y][x])
                Menu.number_of_deaths++;
        }
    }
    Menu.number_alive = Menu.number_alive - Menu.number_of_deaths + Menu.number_of_births;
    let t1 = performance.now();
    Menu.time_to_calculate_better = (t1-t0).toString();
}

/**
 * @name convertBufferToQueue
 * @description converts a standard boolean grid into a byte buffer and a queue (xQueue stores the x coord and yQueue stores the y coord) of active cells (on init every cell is active)
 * @param {boolean[][]} buffer
 * @param {int[]} xQueue
 * @param {int[]} yQueue
 * @param {int[][]} stateBuffer - lowest bit = cell active or not, second bit = state (alive or dead), next bits = number of neighbors (example: 10111 => active, alive, 5 neighbors)
 * @returns {int}
 */
function convertBufferToQueue(buffer, xQueue, yQueue, stateBuffer) {
    let counter = 0;
    for(let y = 0; y < buffer.length; y++){
        for(let x = 0; x < buffer[0].length; x++){

            let neighbors = 0;
            for (let i = -1; i<=1; i++){
                for (let j = -1; j<=1; j++){
                    if(!(i===0 && j===0)){
                        neighbors += buffer[(y+i+buffer.length)%buffer.length][(x+j+buffer[0].length)%buffer[0].length] ? 1:0;
                    }
                }
            }
            stateBuffer[y][x] = neighbors*4 + 1;
            xQueue[counter] = x;
            yQueue[counter] = y;
            counter++;

            if(buffer[y][x]){
                stateBuffer[y][x] += 2;
            }
        }
    }
    return counter;
}

/**
 * @name convertQueueToBuffer
 * @description converts a byte buffer into a boolean buffer
 * @description only the second lowest bit is checked for the information if the cell is alive or dead
 * @param stateBuffer
 * @returns {boolean[][]}
 */
function convertQueueToBuffer(stateBuffer) {
    let buffer = make2DArray(stateBuffer.length, stateBuffer[0].length);
    for(let y = 0; y < buffer.length; y++){
        for(let x = 0; x < buffer[0].length; x++){
            if((stateBuffer[y][x] & 2) == 2)
                buffer[y][x] = true;
        }
    }
    return buffer;
}

/**
 * @name initCellQueueAlgorithm
 * @description Initialize the CellQueue algorithm
 * @param {boolean[][]} buffer
 */
function initCellQueueAlgorithm(buffer) {
    xQueue = new Array(buffer.length * buffer[0].length);
    yQueue = new Array(buffer.length * buffer[0].length);
    stateBuffer = new Array(buffer.length);
    for(let i = 0; i <stateBuffer.length; i++)
        stateBuffer[i] = new Array(buffer[0].length);

    activeCells = convertBufferToQueue(buffer, xQueue, yQueue, stateBuffer);
}

/**
 * @name calculateNextGenerationQueue
 * @description calculates the next generation of the Game of Live with the help of a queue and storing the active cells
 * @description only the active cells and there neighbors are checked for changes
 * @param {int[][]} stateBuffer
 * @param {int[]} xQueue
 * @param {int[]} yQueue
 * @param {int} active
 * @returns {int}
 */
function calculateNextGenerationQueue(stateBuffer, xQueue, yQueue, active) {
    let t0 = performance.now();

    Menu.number_of_generations++;
    Menu.number_of_deaths = 0;
    Menu.number_of_births = 0;

    let activeCells = active;
    let changedCells = 0;

    for (let i = 0; i < activeCells; i++){
        let x = xQueue[i], y= yQueue[i];
        let state = stateBuffer[y][x];
        // check 2nd bit of the state if the cell is Alive
        let wasAlive = ((state & 2) == 2);
        // (10-11 means alive and 2 neighbors => alive; 12-13 means dead and 3 neighbors => alive; 14-15 means alive and 3 neighbors => alive)
        let isAlive = (10 <= state && state <=15);

        if(wasAlive!==isAlive){
            xQueue[changedCells] = x;
            yQueue[changedCells] = y;
            changedCells++;
            if(isAlive)
                Menu.number_of_births++;
            else
                Menu.number_of_deaths++;
        }
        else {
            stateBuffer[y][x] = state - 1;
        }
    }

    activeCells = changedCells;
    for (let i = 0; i < changedCells; i++){
        let x = xQueue[i], y= yQueue[i];
        let wasAlive = ((stateBuffer[y][x] & 2) == 2);
        let temp = wasAlive ? -4 :4;

        for(let delta_y = -1; delta_y<=1; delta_y++){
            for(let delta_x = -1; delta_x<=1; delta_x++){
                let yy = (y+delta_y+stateBuffer.length)%stateBuffer.length;
                let xx = (x+delta_x+stateBuffer[0].length)%stateBuffer[0].length;
                let newState = stateBuffer[yy][xx] + temp;
                if((newState & 1) == 0){
                    xQueue[activeCells] = xx;
                    yQueue[activeCells] = yy;
                    activeCells++;
                    newState += 1;
                }
                stateBuffer[yy][xx] = newState;
            }
        }

        stateBuffer[y][x] -= temp/2;
    }

    Menu.number_alive = Menu.number_alive - Menu.number_of_deaths + Menu.number_of_births;
    let t1 = performance.now();
    Menu.time_to_calculate_queue = (t1-t0).toString();
    return activeCells;
}

/** @namespace */
let sketchFunction = function ( p ) {
    /**
     * make the p object global to make the p5 library functions globally available
     * */
    window.sketch = p;

    /**
     * global function for drawing the boolean buffer
     * @name drawCells
     * @description draws the boolean buffer
     * @param {boolean[][]} buffer
     */
    window.drawCells = function (buffer) {
        p.clear();
        for (let i = 0; i<Menu.resolutionX; i++){
            for (let j = 0; j<Menu.resolutionY; j++){
                if(buffer[j][i])
                    p.fill(Menu.color);
                else
                    p.fill(255);
                p.strokeWeight(2);
                p.stroke(0);
                p.rect(i*boxSize , j*boxSize, (boxSize)-3, (boxSize)-3);
            }
        }
    };

    /**
     * @name drawNextGrid
     * @description calculates the next generation and draws the next grid
     */
    window.drawNextGrid = function () {
        if (!swap) {
            if(Menu.model.localeCompare(model[0])===0){
                calculateNextGenerationNaive(buffer1, buffer2);
            }
            else if (Menu.model.localeCompare(model[1])===0){
                calculateNextGenerationBetter(buffer1, buffer2);
            }
            else if(Menu.model.localeCompare(model[2])===0){
                activeCells = calculateNextGenerationQueue(stateBuffer, xQueue, yQueue, activeCells);
                buffer2 = convertQueueToBuffer(stateBuffer);
            }
            else if(Menu.model.localeCompare(model[3])===0){
                calculateNextGenerationNaive(buffer1, buffer2);
                let tempGen = Menu.number_of_generations,
                    tempAlive = Menu.number_alive;

                calculateNextGenerationBetter(buffer1, buffer2);
                activeCells = calculateNextGenerationQueue(stateBuffer, xQueue, yQueue, activeCells);

                Menu.number_of_generations = tempGen;
                Menu.number_alive = tempAlive;
            }
            swap = true;
            drawCells(buffer2);
        }
        else {
            if(Menu.model.localeCompare(model[0])===0){
                calculateNextGenerationNaive(buffer2, buffer1);
            }
            else if (Menu.model.localeCompare(model[1])===0){
                calculateNextGenerationBetter(buffer2, buffer1);
            }
            else if(Menu.model.localeCompare(model[2])===0){
                activeCells = calculateNextGenerationQueue(stateBuffer, xQueue, yQueue, activeCells);
                buffer1 = convertQueueToBuffer(stateBuffer);
            }
            else if(Menu.model.localeCompare(model[3])===0){
                calculateNextGenerationNaive(buffer2, buffer1);
                let tempGen = Menu.number_of_generations,
                    tempAlive = Menu.number_alive;

                calculateNextGenerationBetter(buffer2, buffer1);
                activeCells = calculateNextGenerationQueue(stateBuffer, xQueue, yQueue, activeCells);

                Menu.number_of_generations = tempGen;
                Menu.number_alive = tempAlive;

            }
            swap = false;
            drawCells(buffer1);
        }
    };

    /**
     * @name setup
     * @description p5 function which is called in the beginning
     * @description initialize the canvas, counters, buffers and other drawing variables
     */
    p.setup = function () {
        Menu.number_of_generations = 0;
        Menu.number_alive = 0;
        Menu.number_of_births = 0;
        Menu.number_of_deaths = 0;

        swap = false;
        buffer1 = make2DArray(Menu.resolutionY, Menu.resolutionX);
        buffer2 = make2DArray(Menu.resolutionY, Menu.resolutionX);

        if(Menu.presets.localeCompare(presets[1])===0)
          fillRandomGrid(buffer1, Menu.probability);

        if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
            initCellQueueAlgorithm(buffer1);


        p.frameRate(Menu.speed);

        let canvas = p.createCanvas(p.windowWidth-windowWidthResize,p.windowHeight-windowHeightResize);
        canvas.parent("canvas_holder");
        boxSize = Math.min((p.windowWidth-windowWidthResize)/Menu.resolutionX, (p.windowHeight-windowHeightResize)/Menu.resolutionY);
        drawCells(buffer1);
    };

    /**
     * @name draw
     * @description p5 function which is called every frame
     * @description draws periodically the next generation
     */
    p.draw = function () {
        if(Menu.startBool) {
            drawNextGrid();
        }
    };


    /**
     * @name windowResized
     * @description p5 function/event which is called if the window is resized
     * @description creates a new canvas and redraws the current buffer
     */
    p.windowResized = function () {
        let canvas = p.createCanvas(p.windowWidth-windowWidthResize,p.windowHeight-windowHeightResize);
        canvas.parent("canvas_holder");
        boxSize = Math.min((p.windowWidth-windowWidthResize)/Menu.resolutionX, (p.windowHeight-windowHeightResize)/Menu.resolutionY);
        if (!swap) {
            drawCells(buffer1);
        }
        else {
            drawCells(buffer2);
        }
    };

    /**
     * @name mouseClicked
     * @description p5 function/event which is called if the mouse is pressed and released
     * @description sets the corresponding cell to alive/dead
     */
    p.mouseClicked = function () {
        let indexI = Math.trunc(p.mouseY/boxSize);
        let indexJ= Math.trunc(p.mouseX/boxSize);

        if(indexI < Menu.resolutionY && indexJ < Menu.resolutionX && indexI >= 0 && indexJ >= 0) {
            if (!swap) {
                if(buffer1[indexI][indexJ])
                    Menu.number_alive--;
                else
                    Menu.number_alive++;
                buffer1[indexI][indexJ] = !buffer1[indexI][indexJ];
                drawCells(buffer1);
                if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                    initCellQueueAlgorithm(buffer1);
            }
            else {
                if(buffer2[indexI][indexJ])
                    Menu.number_alive--;
                else
                    Menu.number_alive++;
                buffer2[indexI][indexJ] = !buffer2[indexI][indexJ];
                drawCells(buffer2);
                if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                    initCellQueueAlgorithm(buffer2);
            }
        }

    };

    /**
     * @name mouseClicked
     * @description p5 function/event which is called if the mouse is dragged across the window
     * @description sets the corresponding cell to alive
     */
    p.mouseDragged = function () {
        if(Menu.drawBool){
            let indexI = Math.trunc(p.mouseY/boxSize);
            let indexJ= Math.trunc(p.mouseX/boxSize);

            if(indexI < Menu.resolutionY && indexJ < Menu.resolutionX && indexI >= 0 && indexJ >= 0) {
                if (!swap) {
                    if(!buffer1[indexI][indexJ])
                        Menu.number_alive++;
                    buffer1[indexI][indexJ] = true;
                    drawCells(buffer1);
                    if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                        initCellQueueAlgorithm(buffer1);
                }
                else {
                    if(!buffer2[indexI][indexJ])
                        Menu.number_alive++;
                    buffer2[indexI][indexJ] = true;
                    drawCells(buffer2);
                    if(Menu.model.localeCompare(model[2]) === 0 || Menu.model.localeCompare(model[3]) === 0)
                        initCellQueueAlgorithm(buffer2);
                }
            }
        }
    };
};

let myp5 = new p5(sketchFunction);